import React, { useState } from 'react';
import { UserContext } from '../services/wihyAPI';

interface UserContextModalProps {
  isOpen: boolean;
  onClose: () => void;
  onSubmit: (userContext: UserContext) => void;
  query: string;
}

const UserContextModal: React.FC<UserContextModalProps> = ({
  isOpen,
  onClose,
  onSubmit,
  query
}) => {
  const [userContext, setUserContext] = useState<UserContext>({
    age: undefined,
    family_size: undefined,
    family_history: [],
    health_concerns: [],
    dietary_restrictions: [],
    activity_level: undefined,
    current_health_concerns: []
  });

  const [familyHistoryInput, setFamilyHistoryInput] = useState('');
  const [healthConcernsInput, setHealthConcernsInput] = useState('');
  const [dietaryRestrictionsInput, setDietaryRestrictionsInput] = useState('');
  const [currentHealthConcernsInput, setCurrentHealthConcernsInput] = useState('');

  if (!isOpen) return null;

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    
    const contextToSubmit: UserContext = {
      ...userContext,
      family_history: familyHistoryInput ? familyHistoryInput.split(',').map(item => item.trim()) : [],
      health_concerns: healthConcernsInput ? healthConcernsInput.split(',').map(item => item.trim()) : [],
      dietary_restrictions: dietaryRestrictionsInput ? dietaryRestrictionsInput.split(',').map(item => item.trim()) : [],
      current_health_concerns: currentHealthConcernsInput ? currentHealthConcernsInput.split(',').map(item => item.trim()) : []
    };

    onSubmit(contextToSubmit);
    onClose();
  };

  const handleSkip = () => {
    onSubmit({});
    onClose();
  };

  return (
    <div className="modal-overlay">
      <div className="modal-content user-context-modal">
        <div className="modal-header">
          <h3>Personalize Your WiHy Response</h3>
          <button className="modal-close" onClick={onClose}>×</button>
        </div>
        
        <div className="modal-body">
          <p className="query-preview">
            <strong>Your question:</strong> "{query}"
          </p>
          
          <p className="context-description">
            Help WiHy provide more personalized health guidance by sharing some optional information about yourself:
          </p>
          
          <form onSubmit={handleSubmit} className="user-context-form">
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="age">Age</label>
                <input
                  type="number"
                  id="age"
                  min="1"
                  max="120"
                  value={userContext.age || ''}
                  onChange={(e) => setUserContext({
                    ...userContext,
                    age: e.target.value ? parseInt(e.target.value) : undefined
                  })}
                  placeholder="Your age"
                />
              </div>
              
              <div className="form-group">
                <label htmlFor="familySize">Family Size</label>
                <input
                  type="number"
                  id="familySize"
                  min="1"
                  max="20"
                  value={userContext.family_size || ''}
                  onChange={(e) => setUserContext({
                    ...userContext,
                    family_size: e.target.value ? parseInt(e.target.value) : undefined
                  })}
                  placeholder="Number in household"
                />
              </div>
            </div>

            <div className="form-group">
              <label htmlFor="activityLevel">Activity Level</label>
              <select
                id="activityLevel"
                value={userContext.activity_level || ''}
                onChange={(e) => setUserContext({
                  ...userContext,
                  activity_level: e.target.value as 'low' | 'moderate' | 'high' | undefined
                })}
              >
                <option value="">Select activity level</option>
                <option value="low">Low (Sedentary/minimal exercise)</option>
                <option value="moderate">Moderate (Regular light exercise)</option>
                <option value="high">High (Very active/athletic)</option>
              </select>
            </div>

            <div className="form-group">
              <label htmlFor="familyHistory">Family Health History</label>
              <input
                type="text"
                id="familyHistory"
                value={familyHistoryInput}
                onChange={(e) => setFamilyHistoryInput(e.target.value)}
                placeholder="e.g., diabetes, heart disease, cancer (comma separated)"
              />
              <small>List any health conditions that run in your family</small>
            </div>

            <div className="form-group">
              <label htmlFor="healthConcerns">Current Health Concerns</label>
              <input
                type="text"
                id="healthConcerns"
                value={healthConcernsInput}
                onChange={(e) => setHealthConcernsInput(e.target.value)}
                placeholder="e.g., weight management, energy levels (comma separated)"
              />
              <small>What health areas are you focusing on?</small>
            </div>

            <div className="form-group">
              <label htmlFor="currentHealthConcerns">Specific Health Issues</label>
              <input
                type="text"
                id="currentHealthConcerns"
                value={currentHealthConcernsInput}
                onChange={(e) => setCurrentHealthConcernsInput(e.target.value)}
                placeholder="e.g., high blood pressure, joint pain (comma separated)"
              />
              <small>Any current health conditions or symptoms</small>
            </div>

            <div className="form-group">
              <label htmlFor="dietaryRestrictions">Dietary Restrictions</label>
              <input
                type="text"
                id="dietaryRestrictions"
                value={dietaryRestrictionsInput}
                onChange={(e) => setDietaryRestrictionsInput(e.target.value)}
                placeholder="e.g., vegetarian, gluten-free, dairy-free (comma separated)"
              />
              <small>Any dietary limitations or preferences</small>
            </div>

            <div className="modal-actions">
              <button type="button" className="btn btn-secondary" onClick={handleSkip}>
                Skip Personalization
              </button>
              <button type="submit" className="btn btn-primary">
                Get Personalized Response
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default UserContextModal;
